script: |
  super -f text -I q393.spq | sort > q393.out

inputs:
  - name: q393.spq
    data: |
      SELECT DISTINCT + col0 * col0 FROM tab1 (FORMAT parquet) WHERE col1 NOT BETWEEN col0 AND CAST ( col0 AS INTEGER );
  - name: tab1

outputs:
  - name: q393.out
    data: |
      2601
      7225
      8281
